import { GlobalContext } from "../Context/GlobalContext";
import "./navbar.css"
import { Link } from "react-router-dom";

const linkStyle = {
    margin: "1rem",
    textDecoration: "none",
  
  };
  

function Navbar() {
    const authorize = useContext(GlobalContext).authorize;
useEffect(()=>{
    return ()=>{
        console.log('navbar')
    }
})
    return (
        <div className="Navbar">
            <div>
                <h3>ReactAuth</h3>
            </div>
            {!localStorage.getItem('email') ? <div>
                <div><Link to='/' style={linkStyle}><div>Login</div></Link></div>

            </div> :
            <div>
          
              <Link to='profile' style={linkStyle}><li>Profile</li></Link>
              
            <li onClick={()=>{
                authorize.signout()
            }}>
        


                Logout
                </li>
                
           
                </div>
                
            
            
          }

        </div>

    )
}
export default Navbar
